	headerRow.appendChild(title);
	guiDiv.appendChild(headerRow);

	//Second ROW ----------------------------------------------------------------------------------------------------

	let row = document.createElement("div");
	row.id = "row1"
	row.style.width = `100%`;
	row.style.height = `5%`;
	row.style.background = "#262522";
	row.style.display = "flex";
	row.style.alignItems = "center";
	row.style.justifyContent = "center";
	guiDiv.appendChild(row);

	let button1 = document.createElement("button");
	button1.id = "StartButton";
	button1.innerText = "START";
	button1.style.width = "33.33%";
	button1.style.height = "100%";
	button1.style.border = "none";
	button1.style.color = "white";
	button1.style.padding = "15px 32px";
	button1.style.display = "flex";
	button1.style.alignItems = "center";
	button1.style.justifyContent = "center";
	button1.style.textDecoration = "none";
	button1.style.background = "#262522";
	button1.style.fontSize = "16px";
	button1.style.cursor = "pointer";

	button1.addEventListener("mouseover", () => {
		button1.style.background = "#2A2926";
	});
	button1.addEventListener("mouseout", () => {
		button1.style.background = "#262522";
	});

	button1.addEventListener("mousedown", () => {
		button1.style.background = "#2A2926";
	});
	button1.addEventListener("mouseup", () => {
		button1.style.background = "#2A2926";
	});

	button1.onclick = () => {
		window.onGuiChange({
			id: button1.id,
			value: "StartClicked"
		});
	};

	row.appendChild(button1);

	for (let i = 0; i < 2; i++) {
		let label = document.createElement("label");
		let item = document.createElement("input");
		
		// Set up label styling
		label.style.display = "flex";
		label.style.width = "33.33%";
		label.style.height = "100%";
		label.style.background = "#262522";
		label.style.alignItems = "center";
		label.style.justifyContent = "center";
		
		// Set text and assign an id based on index
		if (i === 0) {
			label.appendChild(document.createTextNode("White"));
			item.id = "GuiCheckbox1";
		} else if (i === 1) {
			label.appendChild(document.createTextNode("Black"));
			item.id = "GuiCheckbox2";
		}
		
		item.type = "checkbox";
		
		// Ensure the first checkbox is checked by default
		if (i === 0) {
			item.checked = true;
		}
		
		// Add event listener for mutual exclusivity and enforcing at least one checked
		item.addEventListener("change", function() {
			if (!this.checked) {
				// If this checkbox is being unchecked, check if any other checkbox is still checked.
				let siblings = document.querySelectorAll("input[id^='GuiCheckbox']");
				let anyChecked = false;
				siblings.forEach(box => {
					if (box.checked) {
						anyChecked = true;
					}
				});
				// If none are checked, force the first checkbox ("White") to remain checked.
				if (!anyChecked) {
					document.getElementById("GuiCheckbox1").checked = true;
					window.onGuiChange({
						id: "GuiCheckbox1",
						value: true
					});
					return;
				}
			} else {
				// If this checkbox is checked, uncheck the other one.
				let siblings = document.querySelectorAll("input[id^='GuiCheckbox']");
				siblings.forEach(box => {
					if (box !== this) {
						box.checked = false;
					}
				});
			}
			// Notify the change.
			window.onGuiChange({
				id: this.id,
				value: this.checked
			});
		});
		
		label.appendChild(item);
		row.appendChild(label);
	}
	
	/// ADD The SCOREBOARD---------------------------------------------------------------------------------------------
	let contentContainer = document.createElement("div");
