	window.updateBar = function(score,mate_score) {
		let per=0;
		if(score>0)
			per = Math.log2(score+1)*23/2;
		if(score<0){
			per = Math.log2(-score+1)*23/2;
			per=-per;
		}
		per+=50;
		if(per<0)per=0;
		if(per>100)per=100;
		barFill.style.height = per + "%";
		
		if (score >= 0) {
			topText.style.display = "none";
			bottomText.style.display = "block";
			if(mate_score!="none")
				bottomText.innerText = mate_score;
			else
				bottomText.innerText = score+"";
		} else {
			topText.style.display = "block";
			bottomText.style.display = "none";
			if(mate_score!="none")
				topText.innerText = mate_score;
			else
			topText.innerText = score+"";
		}
	};
